import React from 'react';
import { Route, Switch, BrowserRouter} from 'react-router-dom'
import './App.css';
import Home from './Home'
import Login from './Login'
import Signup from './Signup'
import IndividualList from "./IndividualList"
import Friends from './Friends'
import AllUsers from "./AllUsers";
import Setting from "./Setting";
import Main from "./Main"
import MainAdmin from "./MainAdmin"
import Search from "./Search"
import Profile from "./profile"

import { checkSession } from "./actions/session";

class App extends React.Component{

  componentDidMount() {
    checkSession(this); // sees if a user is logged in
  }

  // global state passed down includes the current logged in user.
  state = {
    currentUser: null
  }

  render(){
    const { currentUser } = this.state;
    return (
      <BrowserRouter>
        <Switch>
            <Route 
                    exact path='/'
                    render={() => (<Home/>)} />
            <Route
                    exact path={["/", "/login", "/main"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <Main {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />
            <Route 
                    exact path='/signup'
                    render = {() => (<Signup/>) }/>
            <Route
                    exact path={["/", "/login", "/IndividualList"] /* any of these URLs are accepted. */ }
                    render={ props => (<IndividualList {...props} app={this} />)}
            />
            <Route
                    exact path={["/", "/login", "/Friends"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <Friends {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />
            <Route
                    exact path={["/", "/login", "/AllUsers"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <AllUsers {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />
            <Route
                    exact path={["/", "/login", "/Setting"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <Setting {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />
            <Route
                    exact path={["/", "/login", "/MainAdmin"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <MainAdmin {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />
            <Route
                    exact path={["/", "/login", "/Search"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <Search {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />
            <Route
                    exact path={["/", "/login", "/Profile"] /* any of these URLs are accepted. */ }
                    render={ props => (
                        <div className="app">
                            { /* Different componenets rendered depending on if someone is logged in. */}
                            {!currentUser ? <Login {...props} app={this} /> : <Profile {...props} app={this} />}
                        </div>                   // ... spread operator - provides all of the props in the props object

                    )}
            />        
        </Switch>
      </BrowserRouter>
    )
  }
}

export default App;
